class FABSValidator:
    def __init__(self):
        self.validation_rules = {
            'loan_records': self.validate_loan_records,
            'non_loan_records': self.validate_non_loan_records
        }

    def validate_loan_records(self, record):
        if record['loan_amount'] == 0 or record['loan_amount'] == '':
            return True
        return False

    def validate_non_loan_records(self, record):
        if record['non_loan_amount'] == 0 or record['non_loan_amount'] == '':
            return True
        return False

    def validate_record(self, record):
        if record['record_type'] == 'loan':
            return self.validation_rules['loan_records'](record)
        elif record['record_type'] == 'non_loan':
            return self.validation_rules['non_loan_records'](record)


